const playButton = document.querySelector("#playButton");
const pistaAudio = new Audio(
  "data:audio/x-wav;base64,"
);
// pistaAudio.src = "dog_audio.wav";
const audioCtx = new AudioContext();
console.log(audioCtx);

pistaAudio.addEventListener("playing", () => {
  console.log("Reproduciendo Audio");
});

pistaAudio.addEventListener("ended", () => {
  console.log("Audio Finalizado");
});

playButton.addEventListener("click", () => {
  console.log("- Boton PLAY clickeado -");
  pistaAudio.play();
});

const altButton = document.querySelector("#altButton");

altButton.addEventListener("click", playSound);

function playSound() {
  // pistaAudio.play();
  // Haciuendo uso de la Web Audio API
  const oscilador = audioCtx.createOscillator(); // Crea un nodo de audio que genera un tono
  oscilador.connect(audioCtx.destination); // conect es un metodo para conectar el nodo a otro nodo, para analizarlo, por ejemplo un nodo de ganancia para controlar su volumen o conectarlo directamente a su destino, que representa un dispositivo de reproduccion de audio predeterminado , por lo que mas probable sean sus bocinas.
  oscilador.type = "triangle"; //tomamos la variable oscilador de nuevo y la establecemos a tipo triangulo
  // puede tomar valores como: 'sine', 'square', 'sawtooth', 'triangle'
  oscilador.start(); // llamamos al oscilador para iniciarlo
  // llamamos a setTimeout para controlar la duracion de la reproduccion o sera largo, por elmomento
  setTimeout(() => {
    oscilador.stop();
  }, 500);
}

/**  --------------------------------
 * Los audios en el Front end como recomendacion deben ser tratados de manera especial.
 * Actualmente los navegadores por seguridad limitan mucho el analisis de audio, por medidas estrictas de seguridad.
 * Para nuestro ejemplo estaremos solucionando ese detalle, jalando el audio de manera local, somo la unica forma que se permite, que el archivo de audio este en el mismo servidor, ya que no se puede analizar un audio o se ve limitado, si es leido de un servidor fuera del nuestro.
 *
 * Una solucion rapida es transformar el audio en base64 o trabajar cargando un audio desde nuestra computadora.
 * El problema de usar una codifficacion como base64 es que un audio de 2 segundos se convierte en una linea muy inmensa.
 * Y si queremos hacer la carga o naalisis de un audio largo, no es muy aconsejable.
 */

